@kimpembe3 of Paris Saint-Germain wears his piece-unique GMT Master II ‘Batman’ made by @skeletonconceptofficial. The footballer participated in the creating process of this insane timepiece with the Skeleton Concept’s team of master watchmakers. The GMT Master II has been entirely redesigned to give it a sportswear character that would match the personality of Kimpembe. #SkeletonConcept

Retail price: $ 55,560.00

Photo: @skeletonconceptofficial

@danielricciardo of McLaren F1 team ahead of F1 Grand Prix of Italy wears his unreleased @richardmille RM 67-02 Automatic made with his team’s colors, orange for the dial bridges and orange rubber strap. The case is made of black quartz and carbon TPT, weighting  just 32 grams and the total bezel/caseband/caseback assembly has a slimness of 7.8mm, making the watch really comfortable on wrist. This edition is exclusively available to some RM ambassador and not available to the public. #RichardMille

Price : Not for sale

Photo : @mclaren | @richardmille

@georginagio arrived at the 78th Venice International Film Festival matching her exclusive Hermès Birkin with a rare @rolex Day-Date. This special 36mm Day-Date has a lavender jade dial with diamonds in a 18k yellow gold case. The Day-Date’s case is produced exclusively in precious materials such as yellow gold, white gold, rose gold and platinum. #Rolex

Retail price: $ 49,100.00

Photo: @georginagio
